import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import MainTitle from './components/MainTitle/MainTitle'; 
import MainSearchBar from './components/MainSearchBar/MainSearchBar';
import Boxes from './components/ContentBox/Boxes';
import TopicsPage from './components/TopicsPage/TopicsPage';

function App() {
  return (
    <Router>
      <div className="App">
        <MainTitle />
        <MainSearchBar onSearch={searchTerm => console.log(searchTerm)} />
        <Routes>
          <Route exact path="/" element={<Boxes />} />
          <Route path="/topics/:topicId" element={<TopicsPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
